class Card implements Serializable {
	int suit;
	int kind;
	boolean known;
}


class Deck implements Serializable {
	Card[] cards = new Card[Constants.NUMBER_OF_CARDS];

	
	public Deck() {
		for (int i = 0; i < cards.length; i++) {
			cards[i] = new Card();
		}
	}
}


class Player implements Serializable {
	Card[] hand = new Card[Constants.NUMBER_OF_HAND_CARDS];
	long money;
	int type;
	long handScore;
	long winsCounter;
	long tiesCounter;

	
	public Player() {
		for (int i = 0; i < hand.length; i++) {
			hand[i] = new Card();
		}
	}
}


class Pot implements Serializable {
	long[] bets = new long[Constants.MAX_NUMBER_OF_PLAYERS];
	int numberOfSplits;
}


class Board implements Serializable  {
	Card[] flop = new Card[Constants.NUMBER_OF_FLOP_CARDS];
	Card turn = new Card();
	Card river = new Card();

	
	public Board() {
		for (int i = 0; i < flop.length; i++) {
			flop[i] = new Card();
		}
	}
}


class Game implements Serializable {
	Deck deck = new Deck();
	Board board = new Board();
	Player[] players = new Player[Constants.MAX_NUMBER_OF_PLAYERS];
	int numberOfPlayers;
	Pot pot = new Pot();

	
	public Game() {
		for (int i = 0; i < players.length; i++) {
			players[i] = new Player();
		}
	}
}


class HandStrength implements Serializable {
	long fifthKicker;
	long fourthKicker;
	long thirdKicker;
	long secondKicker;
	long firstKicker;
	long onePair;
	long twoPair;
	long threeOfKind;
	long straight;
	long flush;
	long fullHouse;
	long fourOfKind;
	long straightFlush;

	
	long getValue() {
		long result = 0L;

		int offset = 0;

		
		result |= (fifthKicker << offset);
		offset += 4;

		
		result |= (fourthKicker << offset);
		offset += 4;

		
		result |= (thirdKicker << offset);
		offset += 4;

		
		result |= (secondKicker << offset);
		offset += 4;

		
		result |= (firstKicker << offset);
		offset += 4;

		
		result |= (onePair << offset);
		offset += 4;

		
		result |= (twoPair << offset);
		offset += 4;

		
		result |= (threeOfKind << offset);
		offset += 4;

		
		result |= (straight << offset);
		offset += 4;

		
		result |= (flush << offset);
		offset += 1;

		
		result |= (fullHouse << offset);
		offset += 1;

		
		result |= (fourOfKind << offset);
		offset += 1;

		
		result |= (straightFlush << offset);
		offset += 1;

		return (result);
	}
}


